import{BrowserRouter, Route, Switch} from 'react-router-dom';
import NavBar from './NavBar';

function Main() {
  return (
    <div>
        <BrowserRouter>
        <NavBar/>
        <Switch>
            <Route path = "/" exact component = {Home}/>
            <Route path = "/dashbord" exact component = {Dash}/>
            <Route path = "/about" exact component = {Home}/>

        </Switch>
       </BrowserRouter>

    </div>
  )
}

export default Main;
